  const PdfQp:  React.FC<{affilie: IAffilie}> = ({affilie}) => {



const ref:any =React.createRef();


  return (
    <>
    <div className="Post" ref={ref}>
       <table>
  <tr><th>{affilie.nom}</th></tr>
       </table>
    </div>



        <Pdf targetRef={ref} filename="post.pdf">

         {({toPdf}:any)=> <button onClick={toPdf}>capture as pdf</button>}

        </Pdf>
   </>


  );
};

export default observer(PdfQp);
